import React from 'react';
import PropTypes from 'prop-types';
import styled from 'styled-components';

const EmptyList = ({ src, alt }) => (
  <div className='emptyList-wrap'>
    <img src={src} alt={alt} />
  </div>
);

EmptyList.propTypes = {
  src: PropTypes.string.isRequired,  // src ต้องเป็น string และต้องระบุค่า
  alt: PropTypes.string,  // alt ต้องเป็น string แต่ไม่จำเป็นต้องระบุค่า
};

EmptyList.defaultProps = {
  alt: 'empty',  // กำหนดค่าเริ่มต้นให้ alt
};

export default styled(EmptyList)`
 .emptyList-wrap {
  display: flex;
  justify-content: center;
}
.emptyList-wrap img {
  max-width: 250px;
  width: 100%;
}`;
